public class FindtheDifference {
    public static void main(String[] args) {
        System.out.println(findTheDifference(
                "",
                ""));
    }

    public static char findTheDifference(String s, String t) {
        // Iniciamos el valor char en nulo (vacio)
        char resultado = '\u0000';

        // Cuando sumamos el valor ASCII de cada String y luego obtenemos la diferencia,
        // de esta manera encontramos el valor ASCII de la letra que esta extra
        resultado = (char) (sumaASCII(t) - sumaASCII(s)); // Casting

        return resultado;
    }

    public static int sumaASCII(String x) {

        int acumulador = 0;

        for (int i = 0; i < x.length(); i++) {
            acumulador += x.charAt(i);
        }

        return acumulador;
    }
}
